// i != log.lh.n // log å·²å­˜åœ¨å¹¶ä¸”æœª commitï¼Œnothing to do release(&log.lock);\n} commit // kernel/log.c\nstatic void\ncommit()\n{ if (log.lh.n > 0) { write_log(); // Write modified blocks from cache to log write_head(); // Write header to disk -- the real commit install_trans(0); // Now install writes to home locations log.lh.n = 0; write_head(); // Erase the transaction from the log }\n} å¯¹å•ä¸ª disk block çš„è¯»å†™å…·æœ‰åŸå­æ€§ commit å¯ä¿è¯ç³»ç»Ÿè°ƒç”¨çš„åŸå­æ€§ // kernel/log.c\nstatic void\nwrite_log(void)\n{ int tail; for (tail = 0; tail < log.lh.n; tail++) { struct buf *to = bread(log.dev, log.start+tail+1); // log block struct buf *from = bread(log.dev, log.lh.block[tail]); // cache block // å°† log ä¸­è®°å½•çš„ç¼“å†²å—å·çš„ç¼“å†²å—å¤åˆ¶åˆ° log ç¼“å†²å— memmove(to->data, from->data, BSIZE); // å°† log ç¼“å†²å—å†™å‡ºåˆ°ç£ç›˜ bwrite(to); // write the log brelse(from); brelse(to); }\n} // kernel/log.c\nstatic void\nwrite_head(void)\n{ struct buf *buf = bread(log.dev, log.start); struct logheader *hb = (struct logheader *) (buf->data); int i; // å°†å†…å­˜ä¸­çš„ logheader å¤åˆ¶åˆ° log head çš„ç¼“å†²å— hb->n = log.lh.n; for (i = 0; i < log.lh.n; i++) { hb->block[i] = log.lh.block[i]; } // å°† log head çš„ç¼“å†²å—å†™å‡ºåˆ°ç£ç›˜ bwrite(buf); brelse(buf);\n} install trans // kernel/log.c\nstatic void\ninstall_trans(int recovering)\n{ int tail; for (tail = 0; tail < log.lh.n; tail++) { struct buf *lbuf = bread(log.dev, log.start+tail+1); // read log block struct buf *dbuf = bread(log.dev, log.lh.block[tail]); // read dst memmove(dbuf->data, lbuf->data, BSIZE); // copy block to dst bwrite(dbuf); // write dst to disk if(recovering == 0) bunpin(dbuf); brelse(lbuf); brelse(dbuf); }\n} clean log // kernel/log.c\nstatic void\ncommit()\n{\n... log.lh.n = 0; write_head(); // Erase the transaction from the log\n} recovery // kernel/log.c\nstatic void\nrecover_from_log(void)\n{ read_head(); install_trans(1); // if committed, copy from log to disk log.lh.n = 0; write_head(); // clear the log\n}","breadcrumbs":"æ–‡ä»¶ç³»ç»Ÿ Â» low level Â» log å®ç°","id":"29","title":"log å®ç°"},"3":{"body":"Xv6ä¼šä¸ºæ¯ä¸ªè¿›ç¨‹ç»´æŠ¤ä¸€ä¸ªé¡µè¡¨ï¼Œå†…æ ¸ä¹Ÿæœ‰ä¸€ä¸ªé¡µè¡¨æ–¹ä¾¿å†…æ ¸ä»¥å¯é¢„æµ‹çš„é€Ÿåº¦è®¿é—®ç‰©ç†ç©ºé—´å’Œç¡¬ä»¶èµ„æºã€‚","breadcrumbs":"è™šæ‹Ÿå†…å­˜ Â» åœ°å€ç©ºé—´ Â» å†…æ ¸ç©ºé—´","id":"3","title":"å†…æ ¸ç©ºé—´"},"30":{"body":"uint64\nsys_open()\n{\n... // åˆæ³•æ€§æ£€æŸ¥ begin_op(); ... log_write(); ... log_write(); ... end_op();\n...\n} // kernel/log.c\nvoid\nbegin_op(void)\n{ acquire(&log.lock); while(1){ // æœ‰ç³»ç»Ÿè°ƒç”¨æ­£åœ¨ commit if(log.committing){ sleep(&log, &log.lock); // å¯èƒ½è¶…å‡º log å¤§å°é™åˆ¶ } else if(log.lh.n + (log.outstanding+1)*MAXOPBLOCKS > LOGSIZE){ // this op might exhaust log space; wait for commit. sleep(&log, &log.lock); } else { log.outstanding += 1; release(&log.lock); break; } }\n} // kernel/log.c\nvoid\nend_op(void)\n{ int do_commit = 0; acquire(&log.lock); log.outstanding -= 1; if(log.committing) panic(\"log.committing\"); // æ‰€æœ‰ç³»ç»Ÿè°ƒç”¨éƒ½å·²ç» end_op() if(log.outstanding == 0){ do_commit = 1; log.committing = 1; } else { // begin_op() may be waiting for log space, // and decrementing log.outstanding has decreased // the amount of reserved space. wakeup(&log); } release(&log.lock); // if log.outstanding != 0 // noting to do if(do_commit){ // call commit w/o holding locks, since not allowed // to sleep with locks. commit(); acquire(&log.lock); log.committing = 0; wakeup(&log); release(&log.lock); }\n}","breadcrumbs":"æ–‡ä»¶ç³»ç»Ÿ Â» low level Â» usage","id":"30","title":"usage"},"31":{"body":"// kernle/file.h\n// æ–‡ä»¶æ§åˆ¶å—\nstruct file { enum { FD_NONE, FD_PIPE, FD_INODE, FD_DEVICE } type; int ref; // reference count char readable; char writable; struct pipe *pipe; // FD_PIPE struct inode *ip; // FD_INODE and FD_DEVICE uint off; // FD_INODE short major; // FD_DEVICE\n}; // kernel/fs.h\n// ç£ç›˜ç´¢å¼•ç»“ç‚¹\nstruct dinode { short type; // File type short major; // Major device number (T_DEVICE only) short minor; // Minor device number (T_DEVICE only) short nlink; // Number of links to inode in file system uint size; // Size of file (bytes) uint addrs[NDIRECT+1]; // Data block addresses\n};\n#define NDIRECT 12 // kernel/file.h\n// å†…å­˜ç´¢å¼•ç»“ç‚¹\nstruct inode { uint dev; // Device number uint inum; // Inode number int ref; // Reference count struct sleeplock lock; // protects everything below here int valid; // inode has been read from disk? short type; // copy of disk inode short major; short minor; short nlink; uint size; uint addrs[NDIRECT+1];\n}; // kernel/fs.h\n// ç›®å½•é¡¹\nstruct dirent { ushort inum; char name[DIRSIZ];\n};","breadcrumbs":"æ–‡ä»¶ç³»ç»Ÿ Â» high level Â» ä¸€äº›ç»“æ„","id":"31","title":"ä¸€äº›ç»“æ„"},"32":{"body":"Major number (ä¸»è®¾å¤‡å·) Traditionally, the major number identifies the driver associated with the device. A major number can also be shared by multiple device drivers. Minor number (æ¬¡è®¾å¤‡å·) The major number is to identify the corresponding driver. Many devices may use the same major number. So we need to assign the number to each device that is using the same major number.","breadcrumbs":"æ–‡ä»¶ç³»ç»Ÿ Â» high level Â» addition","id":"32","title":"addition"},"33":{"body":"// kernel/fs.c\nstatic struct inode*\nnamex(char *path, int nameiparent, char *name)\n{ struct inode *ip, *next; if(*path == '/') ip = iget(ROOTDEV, ROOTINO); else ip = idup(myproc()->cwd); while((path = skipelem(path, name)) != 0){ ilock(ip); if(ip->type != T_DIR){ iunlockput(ip); return 0; } if(nameiparent && *path == '\\0'){ // Stop one level early. iunlock(ip); return ip; } if((next = dirlookup(ip, name, 0)) == 0){ iunlockput(ip); return 0; } iunlockput(ip); ip = next; } if(nameiparent){ iput(ip); return 0; } return ip;\n}","breadcrumbs":"æ–‡ä»¶ç³»ç»Ÿ Â» high level Â» ç›®å½•æŸ¥è¯¢","id":"33","title":"ç›®å½•æŸ¥è¯¢"},"34":{"body":"","breadcrumbs":"æ–‡ä»¶ç³»ç»Ÿ Â» high level Â» openç³»ç»Ÿè°ƒç”¨","id":"34","title":"openç³»ç»Ÿè°ƒç”¨"},"35":{"body":"void\nls(char *path)\n{ char buf[512], *p; int fd; if((fd = open(path, 0)) < 0){ fprintf(2, \"ls: cannot open %s\\n\", path); return; } ...\n} int open(const char* file, int omode); file: æ–‡ä»¶åï¼Œç›¸å¯¹è·¯å¾„å’Œç»å¯¹è·¯å¾„ omode: æ‰“å¼€æ–¹å¼ omode value æè¿° O_RDONLY 0 åªè¯» O_WRONLY 1<<0 åªå†™ O_RDWR 1<<1 è¯»å†™ O_CREATE 1<<9 æ–°å»º O_TRUNC 1<<10 åˆ é™¤ è¿”å›å€¼: ä¸€ä¸ªæ•´æ•°è¡¨ç¤ºæ–‡ä»¶æè¿°ç¬¦ï¼Œæ‰“å¼€å¤±è´¥è¿”å›-1","breadcrumbs":"æ–‡ä»¶ç³»ç»Ÿ Â» high level Â» open()","id":"35","title":"open()"},"36":{"body":"// kernel/sysfile.c\nuint64\nsys_open(void)\n{ char path[MAXPATH]; int fd, omode; struct file *f; struct inode *ip; int n; // å–å‚æ•° argint(1, &omode); if((n = argstr(0, path, MAXPATH)) < 0) return -1; // è¡¨ç¤ºå¼€å§‹ä¸€ä¸ªäº‹åŠ¡ begin_op(); if(omode & O_CREATE){ ip = create(path, T_FILE, 0, 0); if(ip == 0){ end_op(); return -1; } } // ä¸éœ€è¦æ–°å»º else { // è·å–ç›®æ ‡æ–‡ä»¶çš„inode if((ip = namei(path)) == 0){ end_op(); return -1; } ilock(ip); // ç›®å½•åªèƒ½ä»¥åªè¯»æ–¹å¼æ‰“å¼€ if(ip->type == T_DIR && omode != O_RDONLY){ iunlockput(ip); end_op(); return -1; } } // è®¾å¤‡æ–‡ä»¶ if(ip->type == T_DEVICE && (ip->major < 0 || ip->major >= NDEV)){ iunlockput(ip); end_op(); return -1; } // åˆ†é…æ–‡ä»¶æ§åˆ¶å—å’Œæ–‡ä»¶æè¿°ç¬¦ if((f = filealloc()) == 0 || (fd = fdalloc(f)) < 0){ if(f) fileclose(f); iunlockput(ip); end_op(); return -1; } // è®¾å¤‡æ–‡ä»¶ if(ip->type == T_DEVICE){ f->type = FD_DEVICE; f->major = ip->major; } // æ–‡ä»¶æˆ–ç›®å½• else { f->type = FD_INODE; f->off = 0; } f->ip = ip; // éåªå†™ f->readable = !(omode & O_WRONLY); // åªå†™æˆ–å¯è¯»å¯å†™ f->writable = (omode & O_WRONLY) || (omode & O_RDWR); // åˆ é™¤æ–‡ä»¶ if((omode & O_TRUNC) && ip->type == T_FILE){ itrunc(ip); } iunlock(ip); // ç»“æŸä¸€ä¸ªäº‹åŠ¡ end_op(); // è¿”å›æ–‡ä»¶æè¿°ç¬¦ return fd;\n}","breadcrumbs":"æ–‡ä»¶ç³»ç»Ÿ Â» high level Â» sys_open()","id":"36","title":"sys_open()"},"37":{"body":"// kernel/sysfile.c\nstatic struct inode*\ncreate(char *path, short type, short major, short minor)\n{ struct inode *ip, *dp; char name[DIRSIZ]; // struct inode* nameiparent(char *path, char *name) // è¿”å›pathçš„çˆ¶ç›®å½•çš„inodeå’Œç›®æ ‡æ–‡ä»¶çš„name // e.g., path=\"/etc/apt/config\" // dp = inode(\"/etc/apt/\") // name = \"config\" if((dp = nameiparent(path, name)) == 0) return 0; ilock(dp); // struct inode* dirlookup(struct inode *dp, char *name, uint *poff) // æŸ¥è¯¢dpç›®å½•ä¸‹nameæ–‡ä»¶çš„inode if((ip = dirlookup(dp, name, 0)) != 0){ iunlockput(dp); ilock(ip); if(type == T_FILE && (ip->type == T_FILE || ip->type == T_DEVICE)) return ip; iunlockput(ip); return 0; } // è‹¥æ–‡ä»¶ä¸å­˜åœ¨ // åˆ†é…inode if((ip = ialloc(dp->dev, type)) == 0){ iunlockput(dp); return 0; } // è®¾ç½®inode ilock(ip); ip->major = major; ip->minor = minor; ip->nlink = 1; // å°†ipå†™å…¥åˆ°ç£ç›˜ iupdate(ip); // ç›®å½•æ–‡ä»¶ if(type == T_DIR){ // Create . and .. entries. // No ip->nlink++ for \".\": avoid cyclic ref count. if(dirlink(ip, \".\", ip->inum) < 0 || dirlink(ip, \"..\", dp->inum) < 0) goto fail; } // æ·»åŠ ç›®å½•é¡¹ if(dirlink(dp, name, ip->inum) < 0) goto fail; if(type == T_DIR){ // now that success is guaranteed: dp->nlink++; // for \"..\" iupdate(dp); } iunlockput(dp); // æœªé‡Šæ”¾ipçš„é” return ip; fail: // something went wrong. de-allocate ip. ip->nlink = 0; iupdate(ip); iunlockput(ip); iunlockput(dp); return 0;\n}","breadcrumbs":"æ–‡ä»¶ç³»ç»Ÿ Â» high level Â» create()","id":"37","title":"create()"},"38":{"body":"// kernel/sysfile.c\nstatic int\nfdalloc(struct file *f)\n{ int fd; struct proc *p = myproc(); // NOFILE: æ¯ä¸ªè¿›ç¨‹æœ€å¤šæ‰“å¼€æ–‡ä»¶æ•° for(fd = 0; fd < NOFILE; fd++){ if(p->ofile[fd] == 0){ p->ofile[fd] = f; // æ–‡ä»¶æè¿°ç¬¦å³ä¸ºä¸‹æ ‡ return fd; } } return -1;\n} struct proc {\n... int pid; // Process ID struct file *ofile[NOFILE]; // Open files struct inode *cwd; // Current directory\n...\n};","breadcrumbs":"æ–‡ä»¶ç³»ç»Ÿ Â» high level Â» file descriptor (æ–‡ä»¶æè¿°ç¬¦)","id":"38","title":"file descriptor (æ–‡ä»¶æè¿°ç¬¦)"},"4":{"body":"//where in kernel/riscv.h\n#define PGSIZE 4096 // bytes per page\n#define PXMASK 0x1FF // 9 bits\n#define PGROUNDUP(sz) (((sz)+PGSIZE-1) & ~(PGSIZE-1))\n#define PGROUNDDOWN(a) (((a)) & ~(PGSIZE-1)) #define PXSHIFT(level) (PGSHIFT+(9*(level)))\n#define PX(level, va) ((((uint64) (va)) >> PXSHIFT(level)) & PXMASK)\n#define MAXVA (1L << (9 + 9 + 9 + 12 - 1))\n#define PA2PTE(pa) ((((uint64)pa) >> 12) << 10) #define PTE2PA(pte) (((pte) >> 10) << 12)","breadcrumbs":"è™šæ‹Ÿå†…å­˜ Â» åœ°å€ç©ºé—´ Â» ç›¸å…³çš„æ•°æ®å®šä¹‰","id":"4","title":"ç›¸å…³çš„æ•°æ®å®šä¹‰"},"5":{"body":"æœ€é‡è¦çš„å‡½æ•° //pagetable_t æŒ‡å‘æ ¹é¡µè¡¨ kernel or process //æ‰¾åˆ°ç›¸åº”çš„é¡µè¡¨é¡¹ï¼Œæ²¡æœ‰åˆ™åˆ†é…\n// where in kernel/vm.c\nwalk(pagetable_t pagetable, uint64 va, int alloc)\n{ if(va >= MAXVA) panic(\"walk\"); for(int level = 2; level > 0; level--) { pte_t *pte = &pagetable[PX(level, va)]; if(*pte & PTE_V) { pagetable = (pagetable_t)PTE2PA(*pte); } else { if(!alloc || (pagetable = (pde_t*)kalloc()) == 0) return 0; memset(pagetable, 0, PGSIZE); *pte = PA2PTE(pagetable) | PTE_V; } } return &pagetable[PX(0, va)];\n} kvminitä¸ºå†…æ ¸ç”³è¯·ä¸€é¡µçš„ç©ºé—´ï¼Œç„¶åè°ƒç”¨kvmmapï¼Œåœ¨å³å°†è£…è½½çš„å†…æ ¸é¡µè¡¨ä¸Šå»ºç«‹ä¸€ç³»åˆ—çš„ç›´æ¥æ˜ å°„ï¼ŒåŒ…æ‹¬I/Oè®¾å¤‡ã€å†…æ ¸ä»£ç å’Œæ•°æ®ã€å†…æ ¸ç©ºé—²å†…å­˜æ®µç­‰ã€‚ ```c++\nkvminit(void)\n{ kernel_pagetable = kvmmake();\n} pagetable_t\nkvmmake(void)\n{ pagetable_t kpgtbl; kpgtbl = (pagetable_t) kalloc(); memset(kpgtbl, 0, PGSIZE); // uart registers kvmmap(kpgtbl, UART0, UART0, PGSIZE, PTE_R | PTE_W); // virtio mmio disk interface kvmmap(kpgtbl, VIRTIO0, VIRTIO0, PGSIZE, PTE_R | PTE_W); // PLIC kvmmap(kpgtbl, PLIC, PLIC, 0x400000, PTE_R | PTE_W); // map kernel text executable and read-only. kvmmap(kpgtbl, KERNBASE, KERNBASE, (uint64)etext-KERNBASE, PTE_R | PTE_X); // map kernel data and the physical RAM we'll make use of. kvmmap(kpgtbl, (uint64)etext, (uint64)etext, PHYSTOP-(uint64)etext, PTE_R | PTE_W); // map the trampoline for trap entry/exit to // the highest virtual address in the kernel. kvmmap(kpgtbl, TRAMPOLINE, (uint64)trampoline, PGSIZE, PTE_R | PTE_X); // allocate and map a kernel stack for each process. proc_mapstacks(kpgtbl); return kpgtbl;\n} void\nkvmmap(pagetable_t kpgtbl, uint64 va, uint64 pa, uint64 sz, int perm)\n{ if(mappages(kpgtbl, va, sz, pa, perm) != 0) panic(\"kvmmap\");\n} //ä¸ºé¡µè¡¨å»ºç«‹æ˜ å°„é¡¹\nint\nmappages(pagetable_t pagetable, uint64 va, uint64 size, uint64 pa, int perm)\n{ uint64 a, last; pte_t *pte; if(size == 0) panic(\"mappages: size\"); a = PGROUNDDOWN(va); last = PGROUNDDOWN(va + size - 1); for(;;){ if((pte = walk(pagetable, a, 1)) == 0) return -1; if(*pte & PTE_V) panic(\"mappages: remap\"); *pte = PA2PTE(pa) | perm | PTE_V; if(a == last) break; a += PGSIZE; pa += PGSIZE; } return 0;\n} åœ¨è°ƒç”¨kvminitç”³è¯·åˆå§‹åŒ–ç©ºé—´è¿‡åï¼Œmainè°ƒç”¨kvminithartæ¥è£…è½½å†…æ ¸é¡µè¡¨çš„æ ¹é¡µè¡¨åœ°å€åˆ°satpå¯„å­˜å™¨ä¸­ void\nkvminithart()\n{ // wait for any previous writes to the page table memory to finish. sfence_vma(); w_satp(MAKE_SATP(kernel_pagetable)); // flush stale entries from the TLB. sfence_vma();\n} åœ¨å†…æ ¸ç©ºé—´ä¸‹ï¼Œmainé©¬ä¸Šå°±è°ƒç”¨procinitï¼Œä¸ºæ¯ä¸ªç”¨æˆ·è¿›ç¨‹åˆ†é…ä¸€ä¸ªå†…æ ¸æ ˆï¼Œè¯¥å†…æ ¸æ ˆå°†è¢«æ˜ å°„åˆ°å†…æ ¸è™šæ‹Ÿåœ°å€ç©ºé—´çš„é«˜åœ°å€éƒ¨åˆ†ï¼Œä½äºtrampolineä¸‹æ–¹ã€‚ç”Ÿæˆè™šæ‹Ÿåœ°å€çš„æ­¥é•¿ä¸º2é¡µï¼Œè€Œä¸”åªå¤„ç†ä½çš„é‚£ä¸€é¡µï¼Œè¿™æ ·é«˜çš„ä¸€é¡µå°±è‡ªåŠ¨æˆäº†ä¿æŠ¤é¡µï¼ˆPTE_Væ— æ•ˆï¼‰ã€‚æ›´æ–°äº†æ‰€æœ‰å†…æ ¸æ ˆçš„PTEä¹‹åï¼Œæœ€åè°ƒç”¨kvminithartæ›´æ–°ä¸€æ¬¡satpå¯„å­˜å™¨ï¼Œåˆ†é¡µç¡¬ä»¶å°±èƒ½ä½¿ç”¨æ–°çš„é¡µè¡¨ã€‚ void\nprocinit(void)\n{ struct proc *p; initlock(&pid_lock, \"nextpid\"); // å¼€å§‹æ—¶p=procï¼Œå³pçš„åœ°å€æ˜¯procæ•°ç»„çš„æœ€å¼€å§‹ä½ç½® // æ¯æ¬¡éå†på°±æŒ‡å‘ä¸‹ä¸€ä¸ªè¿›ç¨‹ç»“æ„ for(p = proc; p < &proc[NPROC]; p++) { initlock(&p->lock, \"proc\"); // Allocate a page for a kernel stack, for each process // Map it high in memory at the va generated by KSTACK, followed by an invalid guard page. char *pa = kalloc(); if(pa == 0) panic(\"kalloc\"); // æŒ‡é’ˆç›¸å‡å°±æ˜¯åœ°å€ç›¸å‡ï¼Œè·å–å